import logo from './logo.svg';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <Button variant="outline-primary">Booty Button :~)</Button>
    </div>
  );
}

export default App;
